import {Link} from "react-router-dom";

export default function Item(props) {
    return (
        <article className="d-flex justify-content-between flex-column border">
            <img src={props.img}/>
            <div class="border-5 bg-secondary rounded">
                <h4 className="bg-danger text-white p-1 rounded">{props.title}</h4>
                <button className="btn w-100 text-center">
                    <Link to="item" className="text-white text-decoration-none">Ver detalle del producto</Link>
                </button>
            </div>
        </article>
    )
}
